frame_eqs_eel:
warp = 0;
rot = 4.1888;


decay = 1;

// for shapes
q1 = .2; // = a
q5 = .6; // = luminance

tic = min(time-tin,.1);
tin = time;

vol = (bass_att + treb_att + mid_att)*.333333;

ra = 10;
treb_avg = tic*(treb_avg*(1/tic - ra) + ra*treb);
mid_avg = tic*(mid_avg*(1/tic - ra) + ra*mid);
bass_avg = tic*(bass_avg*(1/tic - ra) + ra*bass);
vav = tic*(vav*(1/tic - ra) + ra*(bass+treb+mid)*.33333);

tt = tt + tic*treb;
mt = mt + tic*mid;
bt = bt + tic*bass;
vt = vt + tic*vav;

sp = abs(vav - slide)*.1;
slide = if(above(slide,vav),slide-tic*sp,slide+tic*sp) + (1-toc)*vav*.2;
toc = 1;

// for waves
q6 = bt;
q7 = mt;
q8 = tt;
q3 = slide*1.5;

q2 = vt*.5; // speed of opacity cycle

vrt = vrt + tic*min(1,max(0.1,2-vav));

q4 = vrt*6; // = timecycle of hue

